import React from "react";
import "./Dialog.css";

const Dialog = () => {
  return (
    <div>
      <div className="modal-main">
        <label htmlFor="username">username</label>
        <input id="username" type="text" />
        <button>submit</button>
      </div>
    </div>
  );
};

export default Dialog;
